import React from 'react';
import Form from 'react-bootstrap/Form';

const LevelTwoForm = () => {
    return (
        <div>
            <h2>Level Two</h2>
            <Form>
                <Form.Group>
                    <Form.Label>Image Upload</Form.Label>
                    <Form.File></Form.File>
                </Form.Group>
            </Form>
        </div>
    )
}

export default LevelTwoForm;
